    do:  ("l" <-[ptrT] "$r0");;;
    return: (struct.make Log [{
       "d" ::= ![disk.Disk] "d";
       "cache" ::= ![mapT uint64T (sliceT byteT)] "cache";
       "length" ::= ![ptrT] "lengthPtr";
       "l" ::= ![ptrT] "l"
     }])).

